import React, {useState} from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  const [item, setItem] = useState("")
  let sign_in = "http://www.songsterr.com/a/wa/bestMatchForQueryString?s=Wonderwall&a=Oasis"
  fetch(sign_in, {
    mode: 'cors',
    credentials: 'include',
    method: 'POST',
    // headers: headers
})
   .then(res => res.json())
   .then(json => console.log("This is what it pulled", json))

   return (
    <div className="App">
     {item}
    </div>
  );
}

export default App;
